import React from "react";
import { useRouter } from "next/router";

import Navigation from "../components/Navigation";
import { Layout, Menu } from "antd";
const { Item } = Menu;
const { Content } = Layout;

export default () => {
  const router = useRouter();
  return (
    <Layout>
      <Navigation />
      <Layout
        style={{
          padding: "112px 48px 48px 48px"
        }}
      >
        <Content
          style={{
            background: "#fff",
            padding: 24,
            margin: 0,
            minHeight: 280
          }}
        ></Content>
      </Layout>
    </Layout>
  );
};
